import React from "react";
import styled from "styled-components";

const Container = (props) => {
  const Container = styled.div`
    background-color: white;
    position: relative;
    left: 35%;
    width: 65%;
    height: 100%;
  `;
  const Image = styled.div`
    float: right;
  `;
  return (
    <>
      <Container>
        <Image src={props.CloseBtn} />
      </Container>
    </>
  );
};

export default Container;
